import React from "react";

const ProductSection = () => {
  const products = [
    { id: 1, image: "/images/product/product1.jpg", name: "Ring", price: "₹10,000" },
    { id: 2, image: "/images/product/product2.jpg", name: "Necklace", price: "₹20,000" },
    { id: 3, image: "/images/product/product3.jpg", name: "Earrings", price: "₹5,000" },
  ];

  return (
    <section className="product-section">
      <h2>Our Products</h2>
      <div className="product-grid">
        {products.map((product) => (
          <div key={product.id} className="product-card">
            <img src={product.image} alt={product.name} />
            <h3>{product.name}</h3>
            <p>{product.price}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default ProductSection;
